import * as React from 'react';

export const FindOutCard = () => {
  return (
    <div className='bg-red-550 w-full px-6 md:px-0 md:max-w-xl lg:max-w-5xl mx-auto pt-8 pb-16'>
      <div>
        <div>
          <h3>Find out how much you can earn from your space</h3>
        </div>
      </div>
    </div>
  );
};
